import MiApi from "./Components/MiApi"

function App() {
  return (

    <div>
      <div>
        <img src='data:image/jpeg;base64,'/>>
      </div>
      <div className="container-fluid">
        <h1 className='text-center' >Harry Potter-PEDIA</h1>
      </div>

      <div>
        <MiApi />
      </div>
    </div>
  );
}

export default App;
